import React from "react";
import Header from './components/Header'
import Image from './components/Image' 
import car from "./img/gwagon.jpg"

class App extends React.Component {
    state = {
        helpText: "Help text"
    }

  inputClick = (event) => {
    console.log("Clicked", event)
    this.setState({
        helpText: "GWAGON"
    });
  };

  mouseOver() {console.log("Mouse over")}

  render(){
    return (
    <div>
        <Header text="My header"/>
        <h1>{this.props.text}</h1>
        <input placeholder={this.state.helpText} onClick={this.inputClick("1")} onMouseEnter={this.mouseOver} />
        <Image image={car}/>
    </div>
    )
  }
}

export default App
